import './App.css';
import Header from './modules/header';
import SearchBar from './modules/search';
import SongList from './modules/list';



function App() {
  return (
    <div className="App">
      <Header />
      <SearchBar onSe/>
      <div className='main'>
        <SongList />

      </div>
    </div>
  );
}

export default App;
